import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Card, Form, FloatingLabel, Container, Row, Col, ListGroup} from "react-bootstrap";
import CountrySearch from "src/component/CountryInput"

// import {FloatingLabel} from "react-bootstrap";


function App() {
    return (
        <div className="App">
            <header className="App-header">
            </header>
            <Container xs={5}>
                <CountrySearch></CountrySearch>
            </Container>
        </div>
    );
}

export default App;
